Só pra lembrar: 
   Papa Pio XII, ao 1 de julho de 1949, publicou Decreto que afirma a EXCOMUNHÃO AUTOMÁTICA (latae sententiae) aos católicos que se associarem à ideologia de "esquerda" (marxista, comunista, socialista ou similar). 
   Papa João XXIII publicou, aos 4 de abril de 1959, o Dubium, documento do Santo Ofício, reafirmando que não é permitido aos católicos votarem em candidatos de partidos de esquerda (marxistas, comunistas, socialistas ou similar) ou quaisquer relacionados a essa ideologia. 

Outros Papas que excomungaram o socialismo, a ideologia do Nove-Dedos, e aos católicos que votam em candidatos socialistas ou de esquerda:  
- Papa Pio IX, em 8 de dezembro de 1849; 
- Papa Leão XIII, em 29 de junho de 1881; 
- Papa Pio X, em 25 de agosto de 1910; 
- Papa Bento XV, em 1 de novembro de 1914; 
- Papa Pio XI, em 15 de maio de 1931; 
- Papa Pio XII, em 1 de julho de 1949; 
- Papa João XXIII, em 4 de abril de 1959; 
- Papa João Paulo II enfrentou o comunismo na Polônia, Alemanha, Nicarágua... confirmou excomunhão ao comunista Fidel Castro, companheiro do N0ve-Dedos, e sofreu atentado à mando de comunistas soviéticos, em 1981; 
- Papa Bento XVI, em 6 de agosto de 1984, reafirmou a excomunhão da ideologia socialista.

O perfil dos eleitores da esquerda:

● rebeldes sem causa;
● adolescentes tardios;
● marginais de todas espécies;
● frustrados profissionalmente;
● cidadãos que falharam como indivíduo e necessitam do Estado para tutela-los;
● ignorantes de informação;
● doutrinados pelo Gramscismo;

Não pertença a essa horda 🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷
